        \ a statistical model. Unlike a probability, which is a single number that\
        \ represents the likelihood of an event occurring, a probability measure is\
        \ a set of numbers that represent the probability of each possible outcome\
        \ of an experiment.\nThe main difference between a probability and a probability\
        \ measure is that a probability measure can be used to model complex systems\
        \ where the probabilities of different outcomes are not independent. For example,\
